				if (@TOL) {if (TOL == 0)    {}else{write(TOL_Output,   TOL);}}
				if (@ODL) {if (ODL == 1)    {}else{write(ODL_Output,   ODL);}}
				if (@FTO) {if (FTO == 0)    {}else{write(FTO_Output,   FTO);}}
				if (@LOC) {if (LOC == 110)  {}else{write(LOC_Output,   LOC);}}
				if (@SH2) {if (SH2 == 0)    {}else{write(SH2_Output,   SH2);}}
				if (@SH4) {if (SH4 == 0)    {}else{write(SH4_Output,   SH4);}}
				if (@HSP2){                        write(HSP2_Output, HSP2); }
				if (@HSP3){                        write(HSP3_Output, HSP3); }
				if (@HSP4){                        write(HSP4_Output, HSP4); }
				if (@HFI) {if (HFI == 0)    {}else{write(HFI_Output,   HFI);}}
				if (@FRI) {if (FRI == 500)  {}else{write(FRI_Output,   FRI);}}
				if (@HIR) {if (HIR == 25)   {}else{write(HIR_Output,   HIR);}}
				if (@SPB) {if (SPB == 25)   {}else{write(SPB_Output,   SPB);}}
				if (@SPF) {if (SPF == 100)  {}else{write(SPF_Output,   SPF);}}
				if (@ILR) {if (ILR == 50)   {}else{write(ILR_Output,   ILR);}}
				if (@SIR) {if (SIR == 100)  {}else{write(SIR_Output,   SIR);}}
				if (@MCR) {                        write(MCR_Output,   MCR); }
				if (@PEC) {if (PEC == 0)    {}else{write(PEC_Output,   PEC);}}
				if (@PST) {if (PST == 1)    {}else{write(PST_Output,   PST);}}

	/* Part 3: download parameters that overrule standard parameters */
		/* reactivate consistency check */
			write(CMI_Output_Async, 0);
		/* DS402 thresholds */
				/* ACPi x6 only */
		/* Tuning TUN */
				if (@TUN) {if (TUN == 0)    {}else{write(TUN_Output,   TUN);}}		/* delete or keep current values */
				if (@TUNU){if(TUNU == 1)    {}else{write(TUNU_Output, TUNU);}}		/* define tuning method (auto tuning) */
				if (@TNL) {if (TNL == 1)    {}else{write(TNL_Output,   TNL);}}		/* define error scenario */
				if (@AUT) {if (AUT == 0)    {}else{write(AUT_Output,   AUT);}}		/* define tuning trigger (manual trigger) */
				if (@TUL) {if (TUL == 0)    {}else{write(TUL_Output,   TUL);}}		/* define tuning trigger (auto trigger) */
			/* SYN: Results (LQS, LDS, PHS, RSAS) */
				if (@RSAS){if(RSAS == 0)    {}else{write(RSAS_Output, RSAS);}}
				if (@PHS) {if (PHS == 0)    {}else{write(PHS_Output,   PHS);}}
				if (@LDS) {if (LDS == 0)    {}else{write(LDS_Output,   LDS);}}
				if (@LQS) {if (LQS == 0)    {}else{write(LQS_Output,   LQS);}}
			/* ASY: Results (TRA, LFA, IDA, RSA) */
				if (@RSA) {if (RSA == 0)    {}else{write(RSA_Output,   RSA);}}
				if (@IDA) {if (IDA == 0)    {}else{write(IDA_Output,   IDA);}}
				if (@LFA) {if (LFA == 0)    {}else{write(LFA_Output,   LFA);}}
				if (@TRA) {if (TRA == 0)    {}else{write(TRA_Output,   TRA);}}

				if (@LAC) {                        write(LAC_Output,   LAC); }
			write(CMI_Output_Async, 2);			/* save to EEPROM */
		}
		/* DO NOT FORGET: Start_IOCcyc on X2X */
		write(SDC_Mode_Output, SDC_Mode);
